class ClassAverage extends Component {
    render() {
        return(
            <Fragment>
                <div className="display-4">Class III</div>
                <div>{'totalStudent'}Students</div>
                <div className="btn btn-info pull-right">Show Average</div>
                <hr/>
                <span style={{border: "5px solid Red"}}><hr/></span>
                <br/><br/>
            </Fragment>
        )
    }
}
export default ClassAverage
